description:
It's the story of Prince Malachi, a reluctant son forced to take his part as the head of his country after his father dies.

The land he returns to is a wasteland, made destitute by an unknown scourge. Unknown until a sorcerer tells him that the cause of the scourge is a coven of witches. The prince and his merry men head off to defeat the Red Queen and save his kingdom.

